import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { Home, Menu, X, User, LogOut } from 'lucide-react';

const Header: React.FC = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false); // À remplacer par un vrai état d'authentification

  const isHomePage = location.pathname === '/';

  if (isHomePage) {
    return null; // Le header est intégré dans la page d'accueil
  }

  return (
    <header className="bg-white shadow-sm border-b border-gray-200">
      <div className="container mx-auto px-4">
        <div className="flex justify-between items-center h-16">
          {/* Logo */}
          <div 
            className="flex items-center space-x-2 cursor-pointer"
            onClick={() => navigate('/')}
          >
            <div className="w-8 h-8 bg-primary-500 rounded-lg flex items-center justify-center">
              <Home className="w-5 h-5 text-white" />
            </div>
            <span className="text-xl font-bold text-secondary-700">224 Suite</span>
          </div>

          {/* Desktop Navigation */}
          <nav className="hidden md:flex items-center space-x-8">
            <button 
              onClick={() => navigate('/search')}
              className="text-gray-700 hover:text-primary-500 font-medium"
            >
              Rechercher
            </button>
            <button 
              onClick={() => navigate('/dashboard')}
              className="text-gray-700 hover:text-primary-500 font-medium"
            >
              Dashboard
            </button>
            {!isLoggedIn ? (
              <div className="flex items-center space-x-4">
                <button 
                  onClick={() => navigate('/login')}
                  className="text-gray-700 hover:text-primary-500 font-medium"
                >
                  Se connecter
                </button>
                <button 
                  onClick={() => navigate('/register')}
                  className="btn-primary"
                >
                  S'inscrire
                </button>
              </div>
            ) : (
              <div className="flex items-center space-x-4">
                <button className="flex items-center space-x-2 text-gray-700 hover:text-primary-500">
                  <User className="w-4 h-4" />
                  <span>Mon compte</span>
                </button>
                <button 
                  onClick={() => setIsLoggedIn(false)}
                  className="flex items-center space-x-2 text-gray-700 hover:text-red-500"
                >
                  <LogOut className="w-4 h-4" />
                  <span>Déconnexion</span>
                </button>
              </div>
            )}
          </nav>

          {/* Mobile menu button */}
          <button
            className="md:hidden"
            onClick={() => setIsMenuOpen(!isMenuOpen)}
          >
            {isMenuOpen ? (
              <X className="w-6 h-6 text-gray-700" />
            ) : (
              <Menu className="w-6 h-6 text-gray-700" />
            )}
          </button>
        </div>

        {/* Mobile Navigation */}
        {isMenuOpen && (
          <div className="md:hidden py-4 border-t border-gray-200">
            <div className="flex flex-col space-y-4">
              <button 
                onClick={() => {
                  navigate('/search');
                  setIsMenuOpen(false);
                }}
                className="text-gray-700 hover:text-primary-500 font-medium"
              >
                Rechercher
              </button>
              <button 
                onClick={() => {
                  navigate('/dashboard');
                  setIsMenuOpen(false);
                }}
                className="text-gray-700 hover:text-primary-500 font-medium"
              >
                Dashboard
              </button>
              {!isLoggedIn ? (
                <div className="flex flex-col space-y-2">
                  <button 
                    onClick={() => {
                      navigate('/login');
                      setIsMenuOpen(false);
                    }}
                    className="text-gray-700 hover:text-primary-500 font-medium"
                  >
                    Se connecter
                  </button>
                  <button 
                    onClick={() => {
                      navigate('/register');
                      setIsMenuOpen(false);
                    }}
                    className="btn-primary"
                  >
                    S'inscrire
                  </button>
                </div>
              ) : (
                <div className="flex flex-col space-y-2">
                  <button className="flex items-center space-x-2 text-gray-700 hover:text-primary-500">
                    <User className="w-4 h-4" />
                    <span>Mon compte</span>
                  </button>
                  <button 
                    onClick={() => {
                      setIsLoggedIn(false);
                      setIsMenuOpen(false);
                    }}
                    className="flex items-center space-x-2 text-gray-700 hover:text-red-500"
                  >
                    <LogOut className="w-4 h-4" />
                    <span>Déconnexion</span>
                  </button>
                </div>
              )}
            </div>
          </div>
        )}
      </div>
    </header>
  );
};

export default Header;
